import { Button } from "@material-ui/core";
import React from "react";
import { Link } from "react-router-dom";

const Start = () => {
  return (
    <div>
      <Link to="/Question">
        <Button variant="outlined" color="primary">
          начать 
        </Button>
      </Link>
    </div>
  );
};

export default Start;
